import React, { useState } from 'react';
import { TextField, Button, Switch, FormControlLabel } from '@material-ui/core/';


function FormularioJob() {


    <TextField
        onChange={(evento) => {
            setSobrenome(evento.target.value)
        }}
        id="Sobrenome"
        label="Sobrenome"
        required
        variant="outlined"
        margin="dense"
        fullWidth />

}

export default FormularioJob
